import './Display.css'

import { useQuery } from 'urql';

const FILMS_QUERY = `
  query GetLocations {
    locations {
      id
      name
      description
      photo
    }
  }
`;

function Display() {
  const [result] = useQuery({
    query: FILMS_QUERY,
  });

  const { data, fetching, error } = result;

  if (fetching) return "Loading...";
  if (error) return <pre>{error.message}</pre>

